import React, { Component } from 'react';
import './trailer.css';

class trailer extends Component{
    constructor(props) {
        super(props);
        this.state = {
            video: './dummy.mp4'
        };
    }

    render(){
        return(
            <section className="trailer-wrapper">
                <video autoplay loop muted>
                    <source src={this.state.video} type="video/mp4" />
                </video>
            </section>
        );
    }

}

export default trailer;
